(15, '', '2010-09-18', 1, 'ул. Ильинская, 9', 0, 0, 3, 'Фестиваль восточного танца "Парад школ"', '<p><span style="font-size: 12px; line-height: 18px;">Украинская Ассоциация Исполнителей Восточного Танца<br />Киевское Областное Отделение Украинской Ассоциации Исполнителей Восточного Танца<br />Украинский форум о восточном танце &laquo;Raks.com.ua&raquo;<br />Студия восточного танца &laquo;Роксана&raquo;<br />Школа восточного танца &laquo;Захарит&raquo;<br />приглашают Вас на&nbsp;<br /><span style="color: #8040ff;"><span style="font-weight: bold;">Всеукраинский Фестиваль восточного танца в Киеве!&nbsp;</span></span><br /><br /><span style="text-decoration: underline;">Дата</span>:<br /><span style="font-weight: bold;">18 сентября 2010 года:</span><br />?	Парад школ Украины - &laquo;Визитная карточка&raquo;.&nbsp;<br />Представление лучших номеров в номинации соло, дуэт, группа, команда.<br /><br /><span style="font-weight: bold;">19 сентября 2010 года:</span><br />?	Супер гала-пати &laquo;Мёд Востока&raquo; - большая развлекательная программа для зрителей, с выступлением bellydance -звезд Украины и участниц фестиваля.<br /><br /><span style="text-decoration: underline;">Место проведения фестиваля:</span><br />18 сентября - г. Киев, Киево-Могилянская Академия (ул.Ильинская 9)<br />19 сентября - г. Киев, Ресторан &laquo;Queen Bee&raquo; (ул.Малиновского 5)<br /><br /><span style="text-decoration: underline;">Организаторы:</span><br />?	Украинская Ассоциация Исполнителей Восточного Танца &laquo;УАВСТ&raquo;<br />?	Киевское областное отделение УАВСТ<br />?	 Украинский форум о восточном танце &laquo;Raks.com.ua&raquo;<br />?	Студия восточного танца &laquo;Роксана&raquo;&nbsp;<br /><br />Web-поддержка:&nbsp;<a class="postlink" style="color: #072978; text-decoration: none;" href="http://www.uavst.com/" target="_blank">http://www.uavst.com</a>&nbsp;,&nbsp;<a class="postlink" style="color: #072978; text-decoration: none;" href="http://www.raks.com.ua/" target="_blank">http://www.raks.com.ua</a>&nbsp;,&nbsp;<a class="postlink" style="color: #072978; text-decoration: none;" href="http://www.saniya-bellydance.com.ua/" target="_blank">http://www.saniya-bellydance.com.ua</a><br /><br /><span style="text-decoration: underline;">Цели и задачи фестиваля:</span><br />?	Стимулирование межкультурного общения посредством популяризации и развития восточных танцев, как концентрированного проявления эстетических и духовных ценностей Востока и Запада<br />Ознакомление общественности с красотой восточного танца и тенденциями его развития в Украине<br />?	Развитие аматорского хореографического искусства среди детей, молодежи и взрослых<br />?	Утверждение существующих танцевальных коллективов восточных танцев и привлечение новых участников<br />?	Выявление творчески одарённых личностей<br />?	Обмен опытом среди руководителей общественных танцевальных организаций, руководителей и тренеров школ восточных танцев<br /><br /><span style="text-decoration: underline;">Номинации фестиваля &laquo;Парад школ Украины&raquo; - &laquo;Визитная карточка&raquo; (18 сентября):</span><br />?	Соло<br />?	Дуэты<br />?	Группы (3-7 чел.)<br />?	Команды (от 8 чел.)<br />&bull;	Каждая школа может представлять участниц в разных номинациях одновременно (например и соло, и группу, и команду, или только группу, или только солистку).&nbsp;<br />&bull;	Все участники награждаются дипломами.<br /><br /><span style="text-decoration: underline;">Номинации фестиваля &laquo;Парад школ Украины&raquo; - &laquo;Восточная вечеринка&raquo; (19 сентября):</span><br />?	Соло<br /><br /><span style="text-decoration: underline;">Длительность композиций:</span><br />?	3 минуты для всех номинаций.<br /><br />Продолжительность номера должна строго соответствовать ограничениям, заявленным в настоящем Положении. При превышении длительности композиции оргкомитет оставляет за собой право остановить фонограмму.<br /><br />Фонограммы принимаются предварительно до 12 сентября в формате mp3 на e-mail<a style="color: #072978;" href="mailto:931730@ukr.net" target="_blank">931730@ukr.net</a>&nbsp;<br />В день фестиваля с собой иметь дубликат записи на СD-диске.<br /><br />*Организаторы оставляют за собой право отказать в участии в фестивале участникам, не предоставившим свою фонограмму до 12 сентября, без возврата благотворительного взноса.<br /><br /><br />Финансовые условия для участия в фестивале Парад Школ Украины, &laquo;Визитная карточка&raquo;:<br />Благотворительные взносы для участников фестиваля - членов УАВСТ и форумчан форума &laquo;Raks.com.ua&raquo;, имеющих более 500 сообщений&nbsp;<br />Соло: - 190 грн<br />Дуэт - 90 грн/чел<br />Группа - 70 грн/чел<br />Команда - 50 грн/чел<br /><br />Благотворительные взносы для участников фестиваля, не попадающих в выше названные категории:<br />Соло: - 200 грн<br />Дуэты - 100 грн/чел<br />Группы - 80 грн/чел<br />Команда &ndash; 60 грн/чел<br /><br /><br />Билеты на фестиваль &laquo;Визитная карточка&raquo; для зрителей и сопровождающих:&nbsp;<br />&bull;	На одно отделение фестиваля &ndash; 40,50,60 грн (в зависимости от расположения мест)<br />&bull;	На оба отделения фестиваля &ndash; 70,80,90 грн (в зависимости от расположения мест).&nbsp;<br />По вопросам предврительного приобретения билетов&nbsp;<br />обращаться по тел (067)764-67-29, (063)832-52-75<br />ПЛАН ЗАЛА:</span></p>\r\n<p><span style="font-size: 12px; line-height: 18px;"><br /></span></p>', 1, 'Юленька', 0, 0),
