(18, '', '2011-01-19', 1, 'ул. Попудренка, 1А', 0, 0, 8, 'Восточная вечеринка!!!', '<p><span style="font-size: 12px; line-height: 18px;"><span style="font-size: 18px; line-height: normal;"> </span></span></p>\r\n<div style="text-align: center;"><span style="font-weight: bold;">Администрация форума RAKS.COM.UA и организаторы фестиваля "Огни Востока"</span></div>\r\n<p>&nbsp;</p>\r\n<div style="text-align: center;"><a class="postlink" style="color: #072978; text-decoration: none;" href="http://www.radikal.ru/"><img style="border: 0px initial initial;" src="http://s001.radikal.ru/i194/1101/b2/d92828cf583d.jpg" alt="Изображение" /></a>&nbsp;<img style="border: 0px initial initial;" title="сердце" src="http://raks.com.ua/forum/images/smilies/ba.gif" alt=":heart:" />&nbsp;<a class="postlink" style="color: #072978; text-decoration: none;" href="http://www.radikal.ru/"><img style="border: 0px initial initial;" src="http://s19.radikal.ru/i192/1101/07/5008c3056ec8.jpg" alt="Изображение" /></a></div>\r\n<p><br /><span style="font-size: 18px; line-height: normal;">\r\n<div style="text-align: center;"><span style="font-weight: bold;">представляют восточную вечеринку</span></div>\r\n<br /><span style="font-weight: bold;">\r\n<div style="text-align: center;"><span style="color: #bf40ff;"><img style="border: 0px initial initial;" title="Танцюльки" src="http://raks.com.ua/forum/images/smilies/dance.gif" alt=":dance2:" />&nbsp;"ПоRAKSуем под Огнями Востока"&nbsp;<img style="border: 0px initial initial;" title="Танцюльки" src="http://raks.com.ua/forum/images/smilies/dance.gif" alt=":dance2:" /></span></div>\r\n</span></span></p>\r\n<div style="text-align: center;"><span style="font-weight: bold;"><span style="font-style: italic;">23 января 2011 года</span></span></div>\r\n<p>&nbsp;</p>\r\n<div style="text-align: center;"><span style="font-weight: bold;"><span style="font-style: italic;">Начало в 17:00</span></span></div>\r\n<p>&nbsp;</p>\r\n<div style="text-align: center;"><span style="font-weight: bold;"><span style="font-style: italic;">Место проведения: Развлекательный центр&nbsp;<a class="postlink" style="color: #072978; text-decoration: none;" href="http://www.cosmix.com.ua/" target="_blank">КосМикс</a>.<br />Адрес: Попудренка, 1а. М."Дарница"</span></span></div>\r\n<p><br /><br /></p>\r\n<div style="text-align: center;">Вход для зрителей: 40-100 грн</div>\r\n<p>&nbsp;</p>', 1, 'Юлия', 1, 0),
(19, '', '2011-04-17', 1, 'ул. Попудренка, 1А', 0, 0, 8, 'Отмечаем ДР Форума!', '<p><span style="font-size: 12px; line-height: 18px;"> </span></p>\r\n<div style="text-align: center;">Форум о восточном танце RAKS.COM.UA и Центр Восточной Культуры "Роксана"</div>\r\n<p>&nbsp;</p>\r\n<div style="text-align: center;"><a class="postlink" style="color: #072978; text-decoration: none;" rel="nofollow" href="http://www.radikal.ru/"><img style="border: 0px initial initial;" src="http://s001.radikal.ru/i194/1101/b2/d92828cf583d.jpg" alt="Изображение" /></a>&nbsp;<img style="border: 0px initial initial;" title="сердце" src="http://raks.com.ua/forum/images/smilies/ba.gif" alt=":heart:" />&nbsp;<a class="postlink" style="color: #072978; text-decoration: none;" rel="nofollow" href="http://www.radikal.ru/"><img style="border: 0px initial initial;" src="http://s56.radikal.ru/i151/1102/1d/72fc66d410da.jpg" alt="Изображение" /></a></div>\r\n<p>&nbsp;</p>\r\n<div style="text-align: center;">представляют Вашему вниманию восточную вечеринку!<br />У нас есть отличный повод повеселиться!<br />Нашему форуму исполняется 6 лет!&nbsp;<img style="border: 0px initial initial;" title="С днем рождения!" src="http://raks.com.ua/forum/images/smilies/hb.gif" alt=":hb1:" />&nbsp;<br />Отметим День Рождения вместе&nbsp;<img style="border: 0px initial initial;" title="Wink" src="http://raks.com.ua/forum/images/smilies/ad.gif" alt=";)" /></div>\r\n<p><br /><br /></p>\r\n<div style="text-align: center;"><a class="postlink" style="color: #072978; text-decoration: none;" rel="nofollow" href="http://smiles.33b.ru/smile.142272.html"><img style="border: 0px initial initial;" src="http://s17.rimg.info/424f905a2a20ab4006b58b5edd55dc51.gif" alt="Изображение" /></a><span style="font-weight: bold;"><span style="color: #ff40bf;">"День Рождения RAKS.COM.UA"</span></span><a class="postlink" style="color: #072978; text-decoration: none;" rel="nofollow" href="http://smiles.33b.ru/smile.142272.html"><img style="border: 0px initial initial;" src="http://s17.rimg.info/424f905a2a20ab4006b58b5edd55dc51.gif" alt="Изображение" /></a></div>\r\n<p>&nbsp;</p>\r\n<div style="text-align: center;"><a class="postlink" style="color: #072978; text-decoration: none;" rel="nofollow" href="http://www.radikal.ru/"><img style="border: 0px initial initial;" src="http://i040.radikal.ru/1103/03/d218b3446863.jpg" alt="Изображение" /></a></div>\r\n<p><br /><span style="font-weight: bold;"> </span></p>\r\n<div style="text-align: center;">Дата: 17 апреля 2011 г.</div>\r\n<p>&nbsp;</p>\r\n<div style="text-align: center;"><span style="font-weight: bold;">Время: 17:00 до 23:00</span></div>\r\n<p>&nbsp;</p>\r\n<div style="text-align: center;"><span style="font-weight: bold;"><span style="font-style: italic;">Место проведения: Развлекательный центр&nbsp;<a class="postlink" style="color: #072978; text-decoration: none;" rel="nofollow" href="http://www.cosmix.com.ua/" target="_blank">КосМикс</a>.<br />Адрес: Попудренка, 1а. М."Дарница"</span></span></div>\r\n<p>&nbsp;</p>\r\n<div style="text-align: center;"><span style="font-weight: bold;">Вход для зрителей 40 грн, для зрителей с восточными элементами в одежде - 30 грн.</span></div>\r\n<p>&nbsp;</p>\r\n<div class="attachtitle">Вложение:</div>\r\n<div class="attachcontent"><a style="color: #072978;" href="http://raks.com.ua/forum/download/file.php?id=14240&amp;mode=view"><img style="border: 0px initial initial;" src="http://raks.com.ua/forum/download/file.php?id=14240&amp;t=1" alt="plan-zala12.jpg" /></a><br /><span class="gensmall" style="font-size: 10px; color: #000000;">plan-zala12.jpg [ 61.35 Кб | Просмотров: 86 ]</span>&nbsp;</div>\r\n<p><br /><span style="color: #0040bf;"> </span></p>\r\n<div style="text-align: center;">:dance1:&nbsp;<span style="font-style: italic;">Шоу-программа, парад костюмов, конкурсы для зрителей, восточная дискотека, роспись хной, конкурс для исполнителей и дизайнеров с самой независимой судейской коллегией - зрителями</span>&nbsp;<img style="border: 0px initial initial;" title=".dance." src="http://raks.com.ua/forum/images/smilies/dance1.gif" alt=":dance1:" /></div>\r\n<p><br /><br />Если Вы хотите выступить на нашей вечеринке или показать свои костюмы, следующая информация для Вас.<br />Мы ждем сольников, дуэты и малые группы (до 4х человек)<br />Внимание: 50 грн/чел - 1 танец&nbsp;<br /><br />Возрастное ограничение для участников: от 16 и старше&nbsp;<br /><br /><span style="text-decoration: underline;">Регистрация танцовщиц:</span>&nbsp;<br />Предварительная заявка:<br />на e-mail:&nbsp;<a style="color: #072978;" rel="nofollow" href="mailto:931730@ukr.net" target="_blank">931730@ukr.net</a><br /><br />Форма заявки:<br />1. Название номера и краткое описание (например, танец с крыльями или шааби, или ракс шарки)<br />2. Исполнитель (-ли) Ф.И.О. всех участников<br />3. Лига (любители или профессионалы)<br />4. Школа<br />5. Тренер<br />6. Город<br />7. Контактные телефоны<br />8. Музыка в МР3.<br /><br /><span style="text-decoration: underline;">Регистрация дизайнеров</span>&nbsp;<br />Предварительная заявка:<br />На e-mail:&nbsp;<a style="color: #072978;" href="mailto:admin@raks.com.ua" target="_blank">admin@raks.com.ua</a><br /><br />Форма заявки:<br />1. Дизайнер (Ф.И.О., ателье)<br />2. К-во костюмов (1-5 шт.)<br />3. Город<br />4. Контактные телефоны<br />5. Музыка в формате MP3<br /><br />50 грн = до пяти костюмов, каждый последующий костюм +50 грн<br /><br />Приз дизайнеру по итогу зрительского голосования - Подарочный сертификат на 350 грн от:</p>\r\n<p>&nbsp;</p>\r\n<div class="attachtitle">Вложение:</div>\r\n<div class="attachcontent"><a style="color: #072978;" href="http://raks.com.ua/forum/download/file.php?id=14763&amp;mode=view"><img style="border: 0px initial initial;" src="http://raks.com.ua/forum/download/file.php?id=14763&amp;t=1" alt="preciosa.jpg" /></a><br /><span class="gensmall" style="font-size: 10px; color: #000000;">preciosa.jpg [ 33.57 Кб | Просмотров: 0 ]</span>&nbsp;</div>\r\n<p><br /><a class="postlink" style="color: #072978; text-decoration: none;" href="http://www.preciosa.in.ua/" target="_blank">http://www.preciosa.in.ua/</a><br /><br />По вопросам брони столиков звоните:<br />067 7646729<br />063 8325275<br />Юлия aka Магдалена</p>\r\n<p>&nbsp;</p>', 8, 'Юлия', 0, 0),
