(4, 'ЮлькаЗ', '<p>Самая клевая танцевальная школа!!! Да здравствуют МЫ!</p>\r\n<p style="text-align: center;">Расписание:</p>\r\n<p style="text-align: justify;">Пн: 18:00 до 21:00</p>\r\n<p style="text-align: justify;">Вт: 18:00 - 21:00</p>\r\n<p style="text-align: justify;">&nbsp;</p>', 15, 1, 1, 'faka@ra-artis.com', 99084717, 'парр', 'http://raks.com.ua/forum/viewtopic.php?f=121&t=11884', 'http://beautic.com.ua/', 'апрпр, 5, проол', '99999999', '0000000', 1284321937, 6, 1284585951, 1),
(5, 'Пораксуйка', '<p style="text-align: center;">Наша школа лучше всех!</p>\r\n<p>Ждем Вас каждый день в нашей школе</p>', 0, 1, 1, 'aaa@a.ua', 0, '', 'http://raks.com.ua/forum/viewtopic.php?f=121&t=9752', 'http://lingvo.abbyyonline.com', 'ул.Первая, 3', '0677646729', '', 1295982015, 3, 1295982045, 0),
(6, 'Пораксуйка', '<p><span style="font-size: 12px; line-height: 18px;">руководитель Школы: Катерина Парадески&nbsp;<br />в программе обучения - восточные танцы, стрип-дэнс, треннинги по развитию женственности, умению соблазнять и обльщать.&nbsp;<br />занятия проходят в разных районах города.&nbsp;<br />стоимость танцеваьных классов: 25 грн. разовое посещение и 160 грн в месяц. занятия проходят каждый день. в направлении восточные танцы до 10 человек в группе, разделение по разным уровням сложности&nbsp;</span></p>\r\n<p><span style="font-size: 12px; line-height: 18px;"><img style="vertical-align: text-top;" src="http://raks.com.ua/forum/download/file.php?avatar=129_1292451422.jpg" alt="Вот такая я" width="100" height="111" /><br /></span></p>', 21, 8, 1, 'khalisy@mail.ru', 99084717, '', 'http://raks.com.ua/forum/viewtopic.php?f=121&t=6898', 'raks.com.ua/forum', 'ул. Попудренка, 1А', '2454545', '', 1300220972, 2, 1300221166, 0),
